import React from 'react'
import { Modal, ModalHeader, Table } from 'reactstrap'
import { generateString } from '../../specialFunction/specialFunction'
import "./ModalResult"
const ModalResult: React.FC<{
  modal: boolean,
  toggle: () => void,
  result: any
}> = ({
  modal, 
  toggle,
  result,
}) => {

  const list = result?.words.map((word: any, idx: number) => {
    return (
          <tr key={generateString()}>
            <td>{word.en}</td>
            <td>{word.ua}</td>
            <td>{result.answers[idx]}</td>
          </tr>
    )
  });

  return (
    <div>
      <Modal isOpen={modal} toggle={toggle} className="list_my">
        <ModalHeader>
          <h2 className="title">{result?.name}</h2>
          <Table>
            <tbody>
                {list}
            </tbody>
          </Table>
          <div className="bottom-panel" style={{display: "flex"}}> 
            <div>type: en-ua</div>
            <div>true: {result?.result.length}</div>
            <button className="btn btn-outline-success">PASS</button>
          </div>
        </ModalHeader>
      </Modal>
    </div>
  )
}

export default ModalResult;
